import styled from "styled-components";
import CartIcon from "../../images/cart.jpg"
export default function Cart() {
	return(
		<Container>
			<StyledIcon>
				<img src={CartIcon} alt="" />
			</StyledIcon>
			<StyledCart>

			</StyledCart>
		</Container>
	)
}

const StyledCart = styled.div`
	position: absolute;
	width: 600px;
	left: x	150%;
	right: 0;
	height: 100vh;
	top: 0;
	bottom: 0;
`

const Container = styled.div`
	position: relative;
`

const StyledIcon = styled.div`
	width: 100px;
	height: 80px;
	border-radius: 10px 0 0 10px;
	border: rgb(255, 150, 45);
	position: absolute;
	right: 0;
	display: flex;
	align-items: right;
	justify-content: center;
	img {
		width: 80px;
		height: 60px;
	}
`
